import React from 'react';
import photo from '../headshot.jpg'
import {
    AboutPageContainer,
    Photo,
    PhotoBackground,
    AboutContent
} from './about.styled'

const About = () => {
    return (
        <AboutPageContainer>
            <PhotoBackground />
            <Photo src={photo} alt="Jacob Rast Picture" width="200px" height="200px"></Photo>      
            <AboutContent>Hello, I'm Jacob. Master student in</AboutContent>   
        </AboutPageContainer>
    )
}

export default About;
